BD_101056:"\u0110\u01a1n v\u1ecb h\u00ecnh d\u1ea1ng t\u00f3m t\u1eaft kh\u00f4ng h\u1ee3p l\u1ec7 ${unit} \u0111\u1ed1i v\u1edbi h\u00ecnh h\u1ecdc ${geomType}.",BD_101057:"Kh\u00f4ng th\u1ec3 b\u1eaft \u0111\u1ea7u c\u00f4ng vi\u1ec7c \u0111\u01b0\u1ee3c ph\u00e2n b\u1ed1. Vui l\u00f2ng ki\u1ec3m tra l\u1ea1i c\u00e1c thi\u1ebft l\u1eadp d\u1ecbch v\u1ee5 GeoAnalyticsTools v\u00e0 \u0111\u1ea3m b\u1ea3o r\u1eb1ng c\u00f3 \u0111\u1ee7 t\u00e0i nguy\u00ean \u0111\u1ec3 th\u1ef1c hi\u1ec7n c\u00f4ng vi\u1ec7c.",
